    [],nt"num_tags": 15,nt"name": "presquile-national-wildlife-refuge-annual-narrative-report-july-through-december-1975",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Presquile
    National Wildlife Refuge outlines Refuge accomplishments from July through December,
    1975. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    mammals, raptors, fish, reptiles, and diseases- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, collections
    and receipts, and vegetation control. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, violations,
    and safety. Items of interest and photographs are included.",nt"owner_org":
